import ReactDOM from "react-dom";
import "./App.css";
import App from "./App";
import Notifications from "./Notifications";

ReactDOM.render(
  <React.StrictMode>
    <div className="root-notifications">
      <Notifications />
    </div>
    <App />
  </React.StrictMode>,
  document.getElementById("root")
);
